import './App.css';
import {useState, useEffect} from 'react';


function App() {

  const [orders, setOrders] = useState([]);

  useEffect(() => {

      fetch('http://localhost:5000/rapi/v1/orders', {
        'methods' : 'GET',
        headers: {
          'Content-Type':'application/json'
        }
      })
      .then(resp => resp.json())
      .then(resp => setOrders(resp))
      .catch(error => console.log(error))

  }, [])

  return (
    <div className="App">

      {orders.map(order => {
        return (
          <div key = {order.productID}>
            <p>{order[1].notes}</p>
            <p>{order[1].quantity}</p>
            <p>{order[1].orderStatus}</p>
            <p>{order[1].specification}</p>
          </div>
        )
      })}

    </div>

  );
}

export default App;
